import{_ as e,c as t,o as a,U as n}from"./chunks/framework.-9Q_U4ls.js";const u=JSON.parse('{"title":"AT 执行器使用指北","description":"","frontmatter":{},"headers":[],"relativePath":"规范文档/流程规范/AT执行器使用指北.md","filePath":"规范文档/流程规范/AT执行器使用指北.md","lastUpdated":1705116614000}'),i={name:"规范文档/流程规范/AT执行器使用指北.md"},o=n(`<h1 id="at-执行器使用指北" tabindex="-1">AT 执行器使用指北 <a class="header-anchor" href="#at-执行器使用指北" aria-label="Permalink to &quot;AT 执行器使用指北&quot;">​</a></h1><div class="language-plain vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">plain</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span># =============================================</span></span>
<span class="line"><span># Author      : litao</span></span>
<span class="line"><span># =============================================</span></span></code></pre></div><p>Jenkins url: <a href="https://jenkinswh.uniontech.com/view/CI/job/chengdu/job/AT_test/" target="_blank" rel="noreferrer">https://jenkinswh.uniontech.com/view/CI/job/chengdu/job/AT_test/</a></p><h2 id="_1、功能介绍" tabindex="-1">1、功能介绍 <a class="header-anchor" href="#_1、功能介绍" aria-label="Permalink to &quot;1、功能介绍&quot;">​</a></h2><ul><li>支持任意测试机系统语言设置，分辨率设置及用例执行环境搭建；</li><li>支持 IP 为 15 网段的 AMD 架构测试机镜像装机；</li><li>支持任意测试机指定应用，指定范围标签的用例执行；</li><li>支持任意测试机状态检查，是否有正在运行的测试；</li><li>支持配置用例执行时长，防止任务阻塞；</li><li>支持根据应用版本自动查找对应的用例 tag；</li><li>支持异常处理和测试完成的实时消息通知；</li></ul><h2 id="_2、job-介绍" tabindex="-1">2、Job 介绍 <a class="header-anchor" href="#_2、job-介绍" aria-label="Permalink to &quot;2、Job 介绍&quot;">​</a></h2><p>以下按执行流程的顺序介绍，每一步都可以单独执行。</p><h3 id="_1、主入口" tabindex="-1">1、主入口 <a class="header-anchor" href="#_1、主入口" aria-label="Permalink to &quot;1、主入口&quot;">​</a></h3><p>Jenkins url: <a href="https://jenkinswh.uniontech.com/view/CI/job/chengdu/job/AT_test/job/AT_test/" target="_blank" rel="noreferrer">https://jenkinswh.uniontech.com/view/CI/job/chengdu/job/AT_test/job/AT_test/</a></p><p>整个流程的主入口，通过这个入口，连同整个测试流程，镜像装机，环境部署，测试应用及生成报告。</p><p>参数介绍：</p><ul><li>测试机：所有规整到固定区域的测试机，通过测试同学对测试机的习惯命名，在后台映射测试机的详细信息，括号中为测试机 IP 的最后一位；</li><li>测试应用：指定的测试应用的包名，系统根据名称自动拉取对应的仓库代码；</li><li>deb包下载地址：测试上述应用时，需要安装的deb包下载地址，多个地址用“,”隔开，可以为空；</li><li>范围标签：执行测试用例的标签范围，对应用例代码 csv 文件中的标签信息，以 pytest 的mark语法编写；</li><li>系统语言：设置测试机执行用例时的系统语言环境；</li><li>分辨率：设置测试机执行用例时的系统分辨率环境；</li><li>镜像地址：镜像仓库的下载地址，通过 PXE 装机，可以为空，则直接跳过装机环节（目前仅支持部分 AMD 架构的装机）；</li></ul><h3 id="_2、pxe-装机" tabindex="-1">2、PXE 装机 <a class="header-anchor" href="#_2、pxe-装机" aria-label="Permalink to &quot;2、PXE 装机&quot;">​</a></h3><p>Jenkins url: <a href="https://jenkinswh.uniontech.com/view/CI/job/chengdu/job/AT_test/job/IOS_install/" target="_blank" rel="noreferrer">https://jenkinswh.uniontech.com/view/CI/job/chengdu/job/AT_test/job/IOS_install/</a></p><p>输入测试机的用户名，IP，密码，镜像地址后，自动装机，目前仅支持固定 15 网段的部分 AMD 架构的测试机。</p><h3 id="_3、次主入口" tabindex="-1">3、次主入口 <a class="header-anchor" href="#_3、次主入口" aria-label="Permalink to &quot;3、次主入口&quot;">​</a></h3><p>Jenkins url: <a href="https://jenkinswh.uniontech.com/view/CI/job/chengdu/job/AT_test/job/all_client_test/" target="_blank" rel="noreferrer">https://jenkinswh.uniontech.com/view/CI/job/chengdu/job/AT_test/job/all_client_test/</a></p><p>该入口与主入口功能基本一致，只是剥离了PXE装机流程，支持任意测试机的执行流程。</p><h3 id="_4、环境部署" tabindex="-1">4、环境部署 <a class="header-anchor" href="#_4、环境部署" aria-label="Permalink to &quot;4、环境部署&quot;">​</a></h3><p>Jenkins url：<a href="https://jenkinswh.uniontech.com/view/CI/job/chengdu/job/AT_test/job/env/build?delay=0sec" target="_blank" rel="noreferrer">https://jenkinswh.uniontech.com/view/CI/job/chengdu/job/AT_test/job/env/build?delay=0sec</a></p><p>设置测试机的系统语言，分辨率及安装测试所需的依赖包。</p><h3 id="_5、发送代码" tabindex="-1">5、发送代码 <a class="header-anchor" href="#_5、发送代码" aria-label="Permalink to &quot;5、发送代码&quot;">​</a></h3><p>Jenkins url: <a href="https://jenkinswh.uniontech.com/view/CI/job/chengdu/job/AT_test/job/send_code/" target="_blank" rel="noreferrer">https://jenkinswh.uniontech.com/view/CI/job/chengdu/job/AT_test/job/send_code/</a></p><p>根据测试应用名称，拉取对应的应用库代码，并根据测试机上应用版本切换到对应的tag版本，若未找到tag版本，则使用最新的应用库代码，再根据应用库代码中配置的基础库版本，拉取基础库代码。</p><h3 id="_6、用例执行" tabindex="-1">6、用例执行 <a class="header-anchor" href="#_6、用例执行" aria-label="Permalink to &quot;6、用例执行&quot;">​</a></h3><p>Jenkins url: <a href="https://jenkinswh.uniontech.com/view/CI/job/chengdu/job/AT_test/job/run_test/" target="_blank" rel="noreferrer">https://jenkinswh.uniontech.com/view/CI/job/chengdu/job/AT_test/job/run_test/</a></p><p>运行测试机上的用例</p>`,27),s=[o];function l(r,h,c,_,p,b){return a(),t("div",null,s)}const j=e(i,[["render",l]]);export{u as __pageData,j as default};
